import { GET_ALL_PRODUCT } from '../actions/types';

const initialState = {
    cart_product:[]
};

export default function(state = initialState, action ) {
    switch(action.type) {
        case GET_ALL_PRODUCT:
            return action.payload;
        default: 
            return state;
    }
}
